"""Given numRows, generate the first numRows of Pascal's triangle.For example, given numRows = 5,Return[     [1],    [1,1],   [1,2,1],  [1,3,3,1], [1,4,6,4,1]]"""class Solution(object):    def generate(self, numRows):        """        :type numRows: int        :rtype: List[List[int]]        """        res=[]        for i in range(1,numRows+1):            res.append([])            if i==1:                res[-1]=[1]            elif i==1:                res[-1]=[1,2]            else:                res[-1].append(1)                for j in range(1,i-1):                    res[-1].append(res[-2][j-1]+res[-2][j])                res[-1].append(1)        return res